CREATE TABLE `mytable` (
  `transactions_id` BIGINT,
  `sale_date` DATETIME,
  `sale_time` TIME,
  `customer_id` BIGINT,
  `gender` VARCHAR(1024),
  `age` BIGINT NULL,
  `category` VARCHAR(1024),
  `quantiy` BIGINT NULL,
  `price_per_unit` BIGINT NULL,
  `cogs` DOUBLE NULL,
  `total_sale` BIGINT NULL
);

